export function polyline(line: string): number[][][] {
    let polylines: string[] | null = lines[line as keyof typeof lines];
    if(polylines == null) {
        return [[[]]];
    }
    let decoded: number[][][] = [];
    for(let i = 0; i < polylines.length; i++) {
        decoded.push(
            decode(polylines[i])
        );
    }
    return decoded;
}

export function getLines(): string[] {
    let keys: string[] = [];

    for (const key of Object.keys(lines)) {
        keys.push(key);
        // console.log(`${key}: ${(obj as {[key: string]: string})[key]}`);
    }
    return keys;
}

export function getColor(line: string): string {
    let half = line.split("-")[0];
    switch(half) {
        case "Red":
        case "Mattapan":
            return "#DA291C";
        case "Blue":
            return "#003DA5";
        case "Orange":
            return "#ED8B00";
        case "Green":
            return "#00843D";
        case "CR":
            return "#80276C";
        default:
            return "#000000";
    }
}